import React from 'react';
import './Header.css';
import logo from '../sensei-logo-t.svg';
import whiteProfile from '../icons/profileiconwhite.svg';
import colorProfile from '../icons/profileiconcolor.svg'

const Header = () => {

    const isAuthenticated = localStorage.getItem('token') !== null;

    return (
        <header className='header'>
            <div className='left'>
                <img src={logo} alt='logo' className='logo' />
                <p>SoftwareSensei.ai</p>
            </div>
            <nav className='middle'>
                <a href='/'>Home</a>
                <a href='sensei'>Sensei</a>
                <a href='tokens'>Tokens</a>
            </nav>
            <div className='right'>
                {isAuthenticated ? (
                    <img src={whiteProfile} alt='Profile' className='profile-picture' />
                ) : (
                    <button onClick={() => window.location.href = '/signin'}>Sign In</button>
                )}
            </div>
        </header>
    );
};

export default Header;
